const status = context.mapping;
let color = '';
let bgColor = '';

switch(status) {
  case 'active':
    color = '#047857';
    bgColor = '#d1fae5';
    break;
  case 'completed':
    color = '#0369a1';
    bgColor = '#e0f2fe';
    break;
  case 'cancelled':
    color = '#b91c1c';
    bgColor = '#fee2e2';
    break;
  default:
    color = '#334155';
    bgColor = '#f1f5f9';
}

return `<div style="display: inline-block; padding: 4px 8px; border-radius: 4px; background-color: ${bgColor}; color: ${color}; font-weight: 500; text-transform: capitalize;">${status}</div>`;
